import React from 'react';
import { Row, Input, Col, Button} from 'react-materialize'

const Login = ({}) => (
  <Row>
    <Col s={6} offset={'s3'}>
      <Input s={12} label="Username" id="username" />
    </Col>
    <Col s={12}>
      <Button waves='purple'>Sign In</Button>
    </Col>
  </Row>
);

export default Login;
